import mathclass Solution:    def judgePoint24(self, nums):        """        :type nums: List[int]        :rtype: bool        """        if len(nums)==1:            return math.isclose(nums[0],24)        for i in range(len(nums)):            for j in range(len(nums)):                if i!=j:                    rest=[nums[k] for k in range(len(nums)) if k!=i and k!=j]                    if self.judgePoint24(rest+[nums[i]+nums[j]]):return True                    if self.judgePoint24(rest + [nums[i] * nums[j]]): return True                    if self.judgePoint24(rest + [nums[i] - nums[j]]): return True                    if self.judgePoint24(rest + [nums[j] - nums[i]]): return True                    if nums[i]!=0 and self.judgePoint24(rest + [nums[j] / nums[i]]): return True                    if nums[j]!=0 and self.judgePoint24(rest + [nums[i] / nums[j]]): return True        return Falses=Solution()nums=[3,3,8,8]print(s.judgePoint24(nums))